                Rebook your dorm before 7:00 PM to keep your spot.
                <br />
                For new bookings, call (123) 456-7890 after 7:00 PM.
                </p>
            </div>

            <div style={{width:"50%", display:"block" , marginLeft:"25%"}}>
                <input type="text" placeholder="First Name" ></input>
                <input type="text" placeholder="First Name" ></input>
                <input type="text" placeholder="First Name" ></input>
                <input type="text" placeholder="First Name" ></input>
            </div>
            

            <img src={image_2} style={{height:"20px", width:"70%", marginLeft:"15%"}} class="h-100" />
        </div>
    );
    
}

export default Rebook;
